package com.amandris.clients.web.view;import java.util.ArrayList;import org.apache.struts.action.ActionForm;public class OtherUserVoteDataView extends ActionForm{	private String 		positiveVotes;	private String 		negativeVotes;	private String 		totalVotes;	private String		positiveVotesPercentage;	private	String		id;	private	String		login;	private ArrayList 	votes; 		private static final long serialVersionUID = 1020471650626776907L;		public OtherUserVoteDataView()	{		positiveVotes			= "";		negativeVotes			= "";		totalVotes				= "";		positiveVotesPercentage	= "";		id						= "";		login					= "";		votes					= new ArrayList(); 	}	public String getNegativeVotes() {		return negativeVotes;	}	public void setNegativeVotes(String negativeVotes) {		this.negativeVotes = negativeVotes;	}	public String getPositiveVotes() {		return positiveVotes;	}	public void setPositiveVotes(String positiveVotes) {		this.positiveVotes = positiveVotes;	}	public String getPositiveVotesPercentage() {		return positiveVotesPercentage;	}	public void setPositiveVotesPercentage(String positiveVotesPercentage) {		this.positiveVotesPercentage = positiveVotesPercentage;	}	public String getTotalVotes() {		return totalVotes;	}	public void setTotalVotes(String totalVotes) {		this.totalVotes = totalVotes;	}	public ArrayList getVotes() {		return votes;	}	public void setVotes(ArrayList votes) {		this.votes = votes;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getLogin() {		return login;	}	public void setLogin(String login) {		this.login = login;	}	}